import React from 'react'
import { Typography, Layout, Button, Space, Divider } from 'antd';
import styled from 'styled-components'
import {TitleStyled } from '../Sections.styled/Universal'

const DividerStyled = styled(Divider)`
    border-top-color: #00274c;
    margin: 0;
`

const Container = styled(Layout)`
    display: flex;
    align-items: center;
    flex-direction: column;
    height: 100%;
    padding-top: 10%;
    background-color: rgba(0,0,0,0);
`

const HowItWorks: React.FC = () => {
    return (
        <Container size="middle" direction="vertical">
            <TitleStyled>How It Works</TitleStyled>
            <DividerStyled/>
        </Container>
    )
}

export default HowItWorks
